import React from "react";


const Sourceimg = (props)=>{

    const sourceImg = `https://source.unsplash.com/user/erondu/1600x900/?${props.name}`;

    return(
        <>
            <img src= {sourceImg}/>
        </>
    );
}


export default Sourceimg;
